import React from "react";
import "./clientForm.css";
import {
  Layout,
  Menu,
  Icon,
  Contnet,
  Form,
  Input,
  Button,
  DatePicker,
  Select,
  InputNumber,
  Tabs
} from "antd";
import {
  StickyContainer,
  Sticky
} from 'react-sticky';
import {
  Row,
  Col
} from "antd";
import Defaultlayout from "../defaultLayout/defaultLayout";

const TabPane = Tabs.TabPane;
const Option = Select.Option;
const FormItem = Form.Item;
const {
  TextArea
} = Input;
class Cleintforms extends React.Component {
  onChange = (date, dateString) => {
    console.log(date, dateString);
  };
  handleChange = value => {
    console.log(`selected ${value}`);
  };
  inputNumberChange = value => {
    console.log("changed", value);
  };


  render() {
    const renderTabBar = (props, DefaultTabBar) => ( <
      Sticky bottomOffset = {
        80
      } > {
        ({
          style
        }) => ( <
          DefaultTabBar { ...props
          }
          style = {
            { ...style,
              zIndex: 1,
              background: '#fff'
            }
          }
          />
        )
      } <
      /Sticky>
    );

    const formItemLayout = {
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 8
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 16
        }
      }
    };

    return ( <
      Defaultlayout style = {
        {
          margin: "24px 16px",
          padding: 24,
          background: "#fff",
          minHeight: 280
        }
      } >
      <
      StickyContainer >
      <
      Tabs defaultActiveKey = "1"
      renderTabBar = {
        renderTabBar
      } >
      <
      TabPane tab = "Tab 1"
      key = "1"
      style = {
        {
          height: 1500
        }
      } >
      <
      h2 >
      <
      strong style = {
        {
          paddingLeft: 0
        }
      } > < img style = {
        {
          width: 80,
          marginLeft: 90
        }
      }
      src = {
        require('../../image/logo.jpg')
      }
      />CLIENT INVOICE</strong >
      <
      /h2> <
      img style = {
        {
          width: 200,
          marginLeft: 1300
        }
      }
      src = {
        require("../../image/Logo.png")
      }
      />

      <
      Row >
      <
      Form onSubmit = {
        this.handleSubmit
      }
      className = "form"
      style = {
        {
          position: "absolute"
        }
      } >
      <
      Col span = {
        12
      } >
      <
      FormItem >
      <
      strong { ...formItemLayout
      }
      style = {
        {
          paddingLeft: 100
        }
      } >
      From <
      /strong> <
      FormItem label = "Client Id" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      placeholder = "Client Id"
      type = "text" /
      >
      <
      /FormItem> <
      FormItem label = "Name" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      placeholder = "Name"
      type = "text" /
      >
      <
      /FormItem>

      <
      FormItem label = "Email" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      type = "text"
      placeholder = "Email" /
      >
      <
      /FormItem> <
      FormItem label = "Address" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      type = "text"
      placeholder = "Address" /
      >
      <
      /FormItem>

      <
      FormItem label = "Mobile" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      type = "text"
      placeholder = "Mobile" /
      >
      <
      /FormItem> <
      FormItem label = "Business Number" { ...formItemLayout
      } >
      <
      Input style = {
        {
          color: "rgba(0,0,0,.25)"
        }
      }
      type = "text"
      placeholder = "Business Number" /
      >
      <
      /FormItem> <
      FormItem label = "Invoice Number" { ...formItemLayout
      } >
      <
